import React from 'react';
import "./grafits.css";
import TradingViewWidget, { Themes } from 'react-tradingview-widget';

const Related = () => (
  <TradingViewWidget 
  symbol="BTCUSD" 
  theme={Themes.DARK}
  locale="fr"
  width ="100%"

  />
);

export default Related;
